(6319, 186, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:18:\"Dewolfe Title Here\";s:6:\"sender\";s:51:\"[first-name] [last-name] <wordpress@edu.dewolfe.io>\";s:9:\"recipient\";s:20:\"voduycan94@gmail.com\";s:4:\"body\";s:2850:\"<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n <head>\n  <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\n  <title>Demystifying Email Design</title>\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"/>\n</head>\n<body style=\"margin: 0; padding: 30px 0; background-color: #e5e5e5\">\n <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"90%\" style=\"background-image: url(\'https://drive.google.com/uc?export=view&id=1vJWIebRkgrwvVTakMdyws3pCh1gWZG1Z\'); background-size: 60%; background-repeat: no-repeat; background-position: left bottom; max-width: 600px; min-width:300px; margin: 0 auto; background-color: #ffffff\">\n    <tbody>\n        <tr>\n            <td align=\"center\" style=\"padding: 40px 0;\">\n                <img src=\"https://drive.google.com/uc?export=view&id=1ue0Vfa3juTvhNhbqdn1DNYPKW5guWl4T\" alt=\"Creating Email Magic\" width=\"143\" height=\"auto\" style=\"display: block;\" />\n            </td>\n        </tr>\n        <tr>\n            <td align=\"center\" width=\"80%\" style=\"padding: 0 10% 20px;\"  style=\"min-width: 320px;\">\n                Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.\n            </td>\n        </tr>\n         <tr>\n            <td align=\"center\" style=\"padding: 10px 0;\">\n                 <table border=\"0\" cellpadding=\"3\" cellspacing=\"0\" width=\"60%\"  style=\"min-width: 300px;\">\n                    <tr>\n                        <th width=\"50%\" align=\"left\">First Name</th>\n                        <th width=\"50%\" align=\"left\">Last Name</th> \n                    </tr>\n                    <tr>\n                        <td>\n                            [first-name]\n                       </td>\n                       <td>\n                            [last-name]\n                       </td>\n                    </tr>\n                 </table>\n            </td>\n        </tr>\n        <tr>\n            <td align=\"center\" style=\"padding: 10px 0;\">\n                 <table border=\"0\" cellpadding=\"3\" cellspacing=\"0\" width=\"60%\" style=\"min-width: 300px;\">\n                    <tr>\n                        <th width=\"50%\" align=\"left\">Email</th>\n                        <th width=\"50%\" align=\"left\">Phone</th> \n                    </tr>\n                    <tr>\n                        <td>\n                            [email]\n                       </td>\n                       <td>\n                            [phone]\n                       </td>\n                    </tr>\n                 </table>\n            </td>\n        </tr>\n        <tr>\n            <td style=\"padding: 10px 0;\">&nbsp;</td>\n        </tr>\n    </tbody>\n </table>\n</body>\n</html>\";s:18:\"additional_headers\";s:17:\"Reply-To: [email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:1;s:13:\"exclude_blank\";b:0;}'),
